import React from "react";
import { contactdata } from "../../data/contactdata";
import ContactApp from "./ContactApp";

function Contact() {
  return (
    <div>
      <h3>Contact</h3>
      {contactdata.map((cnt, index) => (
        <ContactApp data={cnt} />
      ))}
      <form>
        <input
          id="firstName"
          name="firstName"
          placeholder="First Name"
          type={"text"}
        ></input>
        <br></br>
        <input
          id="lastName"
          name="lastName"
          placeholder="Last Name"
          type={"text"}
        ></input>
        <br></br>
        <input
          id="phoneNum"
          name="phoneNum"
          placeholder="Phone Number"
          type={"text"}
        ></input>
      </form>
    </div>
  );
}

export default Contact;
